import React, {useState} from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import LikedMovieRouter from './components/LikedMoviesRoute';
import MoviesRoute from './components/MoviesRoute';
import Navigation from './components/nav/Navigation';
import LikedMovieProvider from './store/AuthContext';
function App() {
  const [liked, setLiked] = useState([]);
  let set;
  const passLikedMoviesHandler = movieData => (set = movieData);

  console.log(set);
  return (
    <LikedMovieProvider.Provider
      value={[
        {
          title: 'Apple',
          language: 'EN',
          releaseDate: 'May',
          imgSource: 'Yey',
        },
      ]}>
      <div className="App">
        <Navigation />
        {/* -------------- Beginning of router ----------------- */}
        <Router>
          <Routes>
